column1:
@Scaaroyo First & foremost, in war, as a soldier thinking too much will get you killed. Survival is what they’re taught no matter the cost even if they’ve to shoot armed children or women. You don’t do your job, you cost your own fellow members’ lives because everyone has a role to play. Meaning you’re held responsible even if you’re a new guy in the military with no/minimal combat experience.

For example, a squad leader needed one of his rookie members to kill a captured soldier because how can anyone trust that person to do his job when everyone’s lives around him are at risk? They’ve families too so to do nothing & get them killed is right? So you don’t shoot armed and or blind fanatic kids or women thinking they’ve families waiting for them or it’s simply not right because you follow what is morally correct but you allow them to take your own fellow countrymen’s lives & they won’t see their families. Your team will shoot them regardless if they’re kids or women so it’s a no win scenario. Both your side & theirs don’t get to see their families. They’re there to follow orders & do their job while maintaining the rules of engagement. They’re not there for right or wrong. There are no shortcuts. It’s just they have to learn the hard way.

To understand this better look back in WW2. The German SS have created blind fanaticism on kids known as the “Hitler Youth” essentially forcing kids to take up arms at such a young age. I have a friend that told me that his grandpa lost 4 of his close friends to a 10 year old SS German kid that fired a small rocket launcher called the “Panzerfaust” into the leading US tank column in 1945 when Germany was already losing. The tank got on fire & one of his close friends got out on fire screaming in agony until he shot himself. He said that it was his new assistant driver’s fault because he didn’t warn about or took the shot on those armed 3 kids hiding in the bushes on the right side of the main road. He blamed him for the death of his close friends & said “Look what a kid can do! That’s your fucking fault!”. He also said “I promised my men I will get them through this alive. You’re getting in the way of that.” We all have one life.

For those who ask: “Why does Ukraine matter? “ 😔
 
This is why Ukraine matters.

It is the second largest country by area in Europe by area and has a population
of over 40 million - more than Poland.

Ukraine ranks:
1st in Europe in proven recoverable reserves of uranium ores;
2nd place in Europe and 10th place in the world in terms of titanium ore reserves;
2nd place in the world in terms of explored reserves of manganese ores (2.3 billion tons, or 12% of the world's reserves);
2nd largest iron ore reserves in the world (30 billion tons);
2nd place in Europe in terms of mercury ore reserves;
3rd place in Europe (13th place in the world) in shale gas reserves (22 trillion cubic meters)
4th in the world by the total value of natural resources;
7th place in the world in coal reserves (33.9 billion tons)

Ukraine is an important agricultural country:

1st in Europe in terms of arable land area;
3rd place in the world by the area of black soil (25% of world's volume);
1st place in the world in exports of sunflower and sunflower oil;
2nd place in the world in barley production and 4th place in barley exports;
3rd largest producer and 4th largest exporter of corn in the world;
4th largest producer of potatoes in the world;
5th largest rye producer in the world;
5th place in the world in bee production (75,000 tons);
8th place in the world in wheat exports;
9th place in the world in the production of chicken eggs;
16th place in the world in cheese exports.

Ukraine can meet the food needs of 600 million people.

Ukraine is an important industrialised country:

1st in Europe in ammonia production;
Europe's 2nd’s and the world’s 4th largest natural gas pipeline system;
3rd largest in Europe and 8th largest in the world in terms of installed capacity of nuclear power plants;
3rd place in Europe and 11th in the world in terms of rail network length (21,700 km);
3rd place in the world (after the U.S. and France) in production of locators and locating equipment;
3rd largest iron exporter in the world
4th largest exporter of turbines for nuclear power plants in the world;
4th world's largest manufacturer of rocket launchers;
4th place in the world in clay exports
4th place in the world in titanium exports
8th place in the world in exports of ores and concentrates;
9th place in the world in exports of defence industry products;
10th largest steel producer in the world (32.4 million tons).

Ukraine matters. That is why its independence is important to the rest of the world.
 
Let us all together Pray for Ukraine 🙏😢
 
(Originally shared by: @Diana Maxwell
